window.bookSummaryJSON = "<p>Once upon a time, I was a girl who believed in love and happily ever afters.</p> <p>Now, the only thing I believe in is revenge.</p> <p>Unfortunately for me, there’s only one man willing to help me. Hook.</p> <p>I should have known it wouldn’t be out of the goodness of his heart. He doesn’t have one. No, Hook wants his ring on my finger and me on my knees before him, and he won’t take no for an answer. </p> <p>I’m willing to pay any price in order to bring our mutual enemy down...even if it means I lose my soul in the bargain.</p> <p><b>Content warning: </b>abusive ex-partner (emotional, physical).</p>"; 
